options.cartocss:
/** simple visualization */

#usa_states{
  //polygon-fill: #FF6600;
  polygon-opacity: 0;
  line-color: #555;
  line-width: 0.5;
  line-opacity: 1;
}

#usa_states::labels [zoom < 6] {
  text-name: [staat_kurz];
  text-face-name: 'DejaVu Sans Book';
  text-size: 10;
  text-label-position-tolerance: 0;
  text-fill: #666;
  text-halo-fill: #FFF;
  text-halo-radius: 1;
  text-dy: -10;
  text-allow-overlap: true;
  text-placement: point;
  text-placement-type: dummy;
}
#usa_states::labels [zoom >= 6] {
  text-name: [staat_name];
  text-face-name: 'DejaVu Sans Book';
  text-size: 10;
  text-label-position-tolerance: 0;
  text-fill: #666;
  text-halo-fill: #FFF;
  text-halo-radius: 1;
  text-dy: -10;
  text-allow-overlap: true;
  text-placement: point;
  text-placement-type: dummy;
}
